  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The End Stage Renal Disease (ESRD) Quality
  Initiative promotes ongoing CMS strategies to improve the quality of care provided
  to ESRD patients. This initiative supports quality improvement efforts among providers
  and makes available quality information that will enable patients to participate
  in making health care decisions. Quality measures for dialysis facilities are available
  to consumers on Dialysis Facility Compare on the Medicare.gov website.</p>n\",\n\t\"license_title\":
